package uz.example.dagger_2_android3.core.appimport dagger.android.AndroidInjectorimport dagger.android.support.DaggerApplicationimport uz.example.dagger_2_android3.core.di.component.DaggerAppComponentclass App  : DaggerApplication(){    override fun applicationInjector(): AndroidInjector<out DaggerApplication> {        return DaggerAppComponent.builder().application(this).build()    }}